import React from 'react';
import './App.css';
import Headers from './components/vendas/Headers';
import Article from './components/vendas/Article';
import Footer from './components/vendas/Footer';


function AppVendas() {

  return (
    <>
      <Headers />
      <Article />
      <Footer />
    </>


  );
}

export default AppVendas;
